using Acme.Store.Auth.Context;
using Acme.Store.Business.Models;
using Acme.Store.Data.Context;
using Microsoft.AspNetCore.Identity;
using Microsoft.AspNetCore.Identity.EntityFrameworkCore;
using Microsoft.EntityFrameworkCore;

namespace Acme.Store.Api.Extensions
{
    public static class DbMigrationHelpers
    {
        private const string RoleAdmin = "Admin";
        private const string RoleVendedor = "Vendedor";
        public static async Task EnsureSeedData(WebApplication app)
        {
            var services = app.Services.CreateScope().ServiceProvider;
            await EnsureSeedData(services);
        }

        public static async Task EnsureSeedData(IServiceProvider serviceProvider)
        {
            using (var scope = serviceProvider.GetRequiredService<IServiceScopeFactory>().CreateScope())
            {
                var env = scope.ServiceProvider.GetRequiredService<IWebHostEnvironment>();

                var contextBusiness = scope.ServiceProvider.GetRequiredService<AcmeDbContext>();
                var contextIdentity = scope.ServiceProvider.GetRequiredService<AcmeIdentityDbContext>();
                var userManager = scope.ServiceProvider.GetRequiredService<UserManager<IdentityUser>>();
                var roleManager = scope.ServiceProvider.GetRequiredService<RoleManager<IdentityRole>>();

                if (env.IsDevelopment() || env.IsEnvironment("Docker") || env.IsStaging())
                {
                    await contextBusiness.Database.MigrateAsync();
                    await contextIdentity.Database.MigrateAsync();

                    await CriarRoles(roleManager);
                    await CriarUsuario(userManager, "admin@acme.com.br", "Admin!138", RoleAdmin);
                    await EnsureSeedProducts(contextBusiness, userManager);

                }
            }
        }

        private static async Task EnsureSeedProducts(AcmeDbContext context, UserManager<IdentityUser> userManager)
        {
            if (!context.Produtos.Any())
            {
                var vendedor1 = new Vendedor
                {
                    Nome = "Papa-Leguas",
                    Email = "papaleguas@acme.com"
                }; 

                var vendedor2 = new Vendedor
                {
                    Nome = "Coiote",
                    Email = "coiote@acme.com"
                };

                context.Vendedores.AddRange(vendedor1, vendedor2);

                var categoria1 = new Categoria
                {
                    Nome = "Explosivos",
                    Descricao = "Materiais explosivos de alta performance"
                };

                var categoria2 = new Categoria
                {
                    Nome = "Buracos",
                    Descricao = "Buracos que podem ser usados como armadilha."
                };

                context.Categorias.AddRange(categoria1, categoria2);

                await context.SaveChangesAsync();

                context.Produtos.Add(
                    new Produto
                    {
                        Nome = "Dinamite auto-reverso",
                        Descricao = "Dinamite que explode para dentro e implode para fora.",
                        UnidadeVenda = UnidadeVenda.Caixa,
                        Preco = 5500.0,
                        QuantidadeEstoque = 100,
                        CategoriaId = categoria1.Id,
                        VendedorId = vendedor1.Id,
                        Imagem = Imagem1
                    });

                context.Produtos.Add(
                    new Produto
                    {
                        Nome = "TNT Debug",
                        Descricao = "Explosivo TNT com controle de velocidade de explosão.",
                        UnidadeVenda = UnidadeVenda.Caixa,
                        Preco = 10000.0,
                        QuantidadeEstoque = 50,
                        CategoriaId = categoria1.Id,
                        VendedorId = vendedor2.Id,
                        Imagem = Imagem2
                    });

                context.Produtos.Add(
                    new Produto
                    {
                        Nome = "Buraco Portátil - diâmetro 1m",
                        Descricao = "Buraco portátil diâmetro de 1 m, ideal para captura de papa-leguas.",
                        UnidadeVenda = UnidadeVenda.Caixa,
                        Preco = 1600.0,
                        QuantidadeEstoque = 80,
                        CategoriaId = categoria2.Id,
                        VendedorId = vendedor2.Id,
                        Imagem = Imagem3
                    });

                await context.SaveChangesAsync();
            }
        }

        private static async Task<IdentityUser> CriarUsuario(UserManager<IdentityUser> userManager, string email, string senha, string roleName)
        {
            var user = new IdentityUser
            {
                UserName = email,
                Email = email,
                EmailConfirmed = true
            };

            var result = await userManager.CreateAsync(user, senha);
            if (result.Succeeded)
            {
                await userManager.AddToRoleAsync(user, roleName);
                return user;
            }

            return null;
        }

        private static async Task CriarRoles(RoleManager<IdentityRole> roleManager)
        {
            if (! await roleManager.RoleExistsAsync(RoleAdmin))
            {
                await roleManager.CreateAsync(new IdentityRole(RoleAdmin));
            }
            if (! await roleManager.RoleExistsAsync(RoleAdmin))
            {
                await roleManager.CreateAsync(new IdentityRole(RoleVendedor));
            }
            await roleManager.CreateAsync(new IdentityRole(RoleVendedor));
        }


        #region Imagens

        private static string Imagem1 = "data:image/png;base64,";
        private static string Imagem2 = "data:image/png;base64,";
        private static string Imagem3 = "data:image/png;base64,";

        #endregion
    }


}
